import React, { useState } from 'react';

import './css/LogIn.css';
import { IonInput, IonText, IonButton, IonLoading } from '@ionic/react';

const LogIn: React.FC = () => {

    const [showLoading, setShowLoading] = useState(false);
    const [inputValue, setInputValue] = useState<string | null>("");

    setTimeout(() => {
        setShowLoading(false);
    }, 2000);

    return (
        <div id="login-form">
            <div id="Logo"></div>
            <div id="phrase">
                <IonText>O teu gin√°sio da UMinho...</IonText>
            </div>
        <div id="input-form">
            <br></br>
            <IonInput required type="email" id="email-input" placeholder="E-Mail"></IonInput>
            <br></br>
            <IonInput required type="password" id="pass-input" placeholder="Password"
                value={inputValue}
                onChange={(
                ev: React.ChangeEvent<HTMLIonInputElement>
                ): void => setInputValue(ev.target.nodeValue)}
                >
            </IonInput>
        </div>
        <IonButton expand="block" type="submit" id="login-button" onClick={() => {
                setShowLoading(true);
            }
        }>
            Log-In
        </IonButton>
            <IonLoading
                isOpen={showLoading}
                onDidDismiss={() => setShowLoading(false)}
                message={'Espere um momento...'}
                duration={5000}
            />
        </div>
    );
};

export default LogIn;
